},{
    src: Five,
    thumbnail: Five,
    thumbnailWidth: 174,
    thumbnailHeight: 174,
},{
    src: Six,
    thumbnail: Six,
    thumbnailWidth: 174,
    thumbnailHeight: 174,
},{
    src: Seven,
    thumbnail: Seven,
    thumbnailWidth: 174,
    thumbnailHeight: 174,
},{
    src: Eight,
    thumbnail: Eight,
    thumbnailWidth: 174,
    thumbnailHeight: 174,
},]

class Gallary extends Component {
    render() {
        return (
            <div>
                 <Gallery images={IMAGES}/>
            </div>
        )
    }
}

export default Gallary
